import React from "react";

export default function Listbook(props) {
  console.log(props);
  return props.result.map(function (result, index) {
    return (
      <div class="card list-book">
        <h5 class="card-header card-title">
          {props.result[0].title} - {props.result[0].author}
        </h5>

        <div class="card-body">
          <p class="card-text">Rating</p>
          <p class="card-text">{props.result[0].author}</p>
          <p class="card-text">Comments</p>
        </div>
      </div>
    );
  });
}
